export default function Todos(id) {
   const [todosIds, setTodosIds] = useState(null);
   const [todosByIds, setTodosByIds] = useState({});
   return (
      <div key={id}>
         <p>
            {todosByIds[id].title}
            <input
               type="checkbox"
               defaultChecked={todosByIds[id].completed ? "checked" : ""}
            />
         </p>
      </div>
   );
}
